import React from "react";
import Menu from "../../private/pages/menu";
import Login from "../../private/pages/login";
import Page404 from "../../public/page404";
const Switch = ({ page, }) => {
  switch (page) {
    case "login":
      return <Login />;
    case "menu":
      return <Menu />;
      case "user":
      return <User />;
    default:
      return <Page404>Invalid page</Page404>;
  }
};

export default Switch;
